"""
	pathContainer.py
	~~~~~~~~~

	This module implements the PathContainer class, which stores, and
	enables the handling and manipulation of Cell connecting patterns,
	in order to facilitate puzzle generation and solving.
	
	The idea is that, at runtime, rather than calculate the possible way
	to connect any two cells for every two cells, a database is maintained
	that allows each cell pair to have it's possible connecting paths tested
	from a pre-generated set of possible connections, minimizing number of
	calculations that need to take place when the program is actually run.

	:Mandla Moyo, 2014.
"""

